description:
JimSlip - Stella Cox - Fishnet Tights And Pleated Mini-skirt

The above keywords should be enough to have you reaching for the Kleenex! Yes folks, we are back in the UK this week, with the lovely Stella, on a well earned holiday, errm well from the other holiday in Europe. OK, already, sometimes you need a holiday to get over the last holiday! A bit like the Royal family! The gorgeous Stella arrived in a raincoat, a tiny pleated mini-skirt, fishnet tights and frilly panties. &quot;What could possibly happen?&quot; I hear you ask. Well, I will tell you what happened, I was the very picture of decorum and managed to hold my camcorder steady for at least 2 or 3 minutes until I was consumed in a maelstrom of lust (My auto spell just corrected me to a &quot;Mailroom of lust&quot;) You see I had just had a glimpse of those frilly panties lying in wait, nay, begging to be torn to shreds or at least roughly yanked to one side!...

